# In[1]:


import numpy as np 
import libpysal
import spreg


# In[2]:


libpysal.examples.explain("baltim")


# In[3]:


# Read Baltimore data
db = libpysal.io.open(libpysal.examples.get_path("baltim.dbf"), "r")
ds_name = "baltim.dbf"

# Read dependent variable
y_name = "PRICE"
y = np.array(db.by_col(y_name)).T
y = y[:, np.newaxis]

# Read exogenous variables
x_names = ["NROOM", "NBATH", "PATIO", "FIREPL", "AC", "GAR", "AGE", "LOTSZ", "SQFT"]
x = np.array([db.by_col(var) for var in x_names]).T


# In[4]:


# Read spatial data
ww = libpysal.io.open(libpysal.examples.get_path("baltim_q.gal"))
w = ww.read()
ww.close()
w_name = "baltim_q.gal"
w.transform = "r"


# Basic Spatial 2SLS
# The model to estimate is: 
#                                     $$y = \rho Wy + X\beta + \epsilon$$
#                                     
# where you use WX as instruments of Wy

# Wy endogenous = simultaneous equation bias
# $$y = Z\theta + u$$
# $$Z = [WyX]$$
# $$\theta = [\rho\beta']'$$

# In[5]:


model = spreg.GM_Lag(
    y,
    x,
    w=w,
    name_y=y_name,
    name_x=x_names,
    name_w="baltim_q",
    name_ds="baltim"
)
print(model.summary)


# Second order spatial lags
# You can also use [WX, W^2X] as instruments of Wy. 

# In[6]:


# using second order spatial lags for the instruments, set w_lags = 2
model2 = spreg.GM_Lag(
    y,
    x,
    w=w,
    w_lags=2,
    name_y=y_name,
    name_x=x_names,
    name_w="baltim_q",
    name_ds="baltim"
)
print(model2.summary)


# Spatial Diagnostics

# In[7]:


model = spreg.GM_Lag(
    y,
    x,
    w=w,
    spat_diag=True,
    name_y=y_name,
    name_x=x_names,
    name_w="baltim_q",
    name_ds="baltim"
)
print(model.summary)


