# White Standard Errors

# In[8]:


model = spreg.GM_Lag(
    y,
    x,
    w=w,
    robust="white",
    spat_diag=True,
    name_y=y_name,
    name_x=x_names,
    name_w="baltim_q",
    name_ds="baltim"
)
print(model.summary)


